import React from 'react';
import AppLayout from '../components/AppLayout';

<style jsx global>{`
  html,
  body {
    padding: 0;
    margin: 0;
    font-family: Lobster;
  }

  * {
    box-sizing: border-box;
  }
`}</style>;

const Home = () => {
  return <AppLayout />;
};

export default Home;
